import React, { Component }from "react";
class Item extends Component{
  render(){
    const{name,done}=this.props
    return(
      <div>
      <label>
            <input type="checkbox" defaultChecked={done}/>
            <span>
          {name}
            </span>
          </label>
          <button>删除</button>
      </div>
    )
  }
}
export default Item ;
